import React, {Component} from "react";

import hero from "../../../Images/hero-bg.jpg"

export class Home extends Component {


    render() {


        return (
            <div className="flex">
                <div className="flex mt-5 mb-5 flex-wrap justify-center items-center mx-auto">
                    <div>
                        <h2 className="text-6xl font-bold text-center">Welcome to Chicago!</h2>
                        <img src={hero} alt="Main Image"/>
                    </div>
                </div>
            </div>
        );
    }
}
